import React from "react"
import Contact from "./Contact";
import pds from "./ProfileData.module.css"

const ProfileData = (props) => {
    return <div className={pds.aboutME}>

        {props.profile.aboutMe && <div>
            {props.profile.aboutMe}
        </div>}
        {props.profile.lookingForAJob ?
            <div>
                Im looking for a job
            </div>
            :
            <div>
                Im have a job
            </div>}
        {props.profile.lookingForAJobDescription &&
        <div>
            {props.profile.lookingForAJobDescription}
        </div>
        }
        <div className={pds.contacts}>
            <div>
                {props.IsMyPage && <button onClick={props.ContactsEditingOn}>
                    edit information
                </button>}
            </div>

        My contacts : {Object.keys(props.profile.contacts).map(key=>{
        return <Contact key={key} ContactName={key} ContactValue={props.profile.contacts[key]} />
    })}
        </div>
    </div>
}

export default ProfileData
